import { BaseComponent } from "../../core/BaseComponent";
import {  component, TAG } from "../../helpers";
import { ToDoFilter } from "../ToDoFilter";
import { ToDoForm } from "../ToDoForm";

export class ToDoList extends BaseComponent {
  _filterState = null;
  _formModel;
  _filterModel;

  render() {

  }

  _createElements() {
    let formElement, filterElement;

    [formElement, this._formModel] = component(ToDoForm);
    [filterElement, this._filterModel] = component(ToDoFilter, { filter: this._filterState });
    this._items = TAG("div", "todo-items");

    return TAG("div", "todo-list", [formElement, filterElement, this._items]);
  }

  _bindEvents() {
    this._formModel.onUpdate(title => this._addItem(title));
    this._filterModel.onUpdate(filter => {

    });
  }

  _addItem(title) {
    console.log(title);
  }
}
